function whatIsInAName(collection, source) {
  // filter the objects that does not contain the elements in source
  let newCollection = collection.filter((a,b,c) => {
    // count the number of true values
    let nTrue = 0;
    // loop through the collection and check if contain the given property
    for(let i =0 ; i < Object.keys(a).length; i++){
        if(source.hasOwnProperty(Object.keys(a)[i])){ 
          if(a[Object.keys(a)[i]] == source[Object.keys(a)[i]]){
              nTrue++;
          }
        }
    }
    // if it the object has all the same key value pair then return it
    if(nTrue === Object.keys(source).length){
        return a;
    }
  });

  return newCollection;
}

